import React from "react";
import "../css/Feed.css";

function Feed() {
  return (
    <div className="main">
      <div className="right-side">
        <div className="profile">
          <img
            src="/images/avatar-1.jpeg"
            alt="profile-picture"
            style={{ height: "30px", padding: "1rem" }}
          />
          FirstName LastName
        </div>
      </div>
      <div className="timeline">Feed</div>
      <div className="left-side">Friends</div>
    </div>
  );
}

export default Feed;
